function DateChange(n){var t=new Date(n.target.value),i=t.getFullYear(),r=new Date,u=r.getFullYear()-i;$("#Age").val(u)}function readURL(n){if(n.files&&n.files[0]){var t=new FileReader;t.onload=function(n){$("#displayPicture").attr("src",n.target.result)};t.readAsDataURL(n.files[0])}}$("#dpSelecter").change(function(){readURL(this)});